import React, { Component } from "react";
import TulajokService from "../service/TulajokService";
import tulajokService from "../service/TulajokService";
class TagokComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      tulajok: [],
    };
  }
  
  componentDidMount(){
    TulajokService.getTulajok().then((data) => {
        this.setState({ tulajok: data })
        console.log(this.state.data)
      })
      .catch(function (ex) {
          console.log('Response parsing failed. Error: ', ex);
      });;
}

  render() {
    return (
      <div>
        <EmployeeList tagok={this.state.tagok} />
        <table className="tagokTable">
          <thead>
            <tr>
              <th>Nev</th>

              <th>Cim</th>

              <th>Egyesulet</th>

              <th>Fajtak</th>

              <th>Eredmenyek</th>
            </tr>
          </thead>
          <tbody>
          {
                            this.state.tulajok.map(tulaj =>
                                    <tr key={tulaj.id}>
                                        <td>{tulaj.id}</td>
                                        <td>{tulaj.bookName}</td>
                                        <td>{tulaj.author}</td>
                                    </tr>
                            )
                        }
          </tbody>
        </table>
      </div>
    );
  }
}

export default TagokComponent;
